import { Fragment } from "react";
import Home from "../pages/Home";
import Footer from "./Footer";
import Header from "./Header";

const Defaullayout = ()=>{
return (
    
  <Fragment>
        <Header/>,
    <Home/>,
    <Footer/>
  </Fragment>
)
}
export default Defaullayout;
